description:
As Zipper's Clown Palace (a strip bar) closes, Neil wanders in and decides to hold the dancers, bartender, and remaining customers hostage. He torments them with little tasks he wants performed, playing on their weaknesses and relying on his gun for intimidation. Eventually the hostages begin formulating plans to thwart his control.

